template<class T, size_t size>
struct Array
{
	T data[size];

	T get(size_t index)
	{
		if (index >= size) {
			return (T)NULL;
		}
		return data[index];
	}

	T* getReference(size_t index)
	{
		if (index >= size) {
			return NULL;
		}
		return &data[index];
	}

	void set(size_t index, T value)
	{
		if (index >= size) {
			return;
		}
		data[index] = value;
	}

	operator T*()
	{
		return &data[0];
	}
};

